import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('#searchInput');
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_search.png'));

    // Wait for search suggestions to appear
    await page.waitForSelector('.search-suggestions');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_suggestions_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_suggestions_visible.png'));

    // Click on the first suggestion
    await page.click('.suggestion-item');

    // Wait for the results to load
    await page.waitForSelector('.search-results');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_search_results.png'));

    // Extract data from the search results
    const results = await page.$$eval('.product-card', cards => {
      return cards.map(card => ({
        title: card.querySelector('.product-title').innerText,
        price: card.querySelector('.product-price').innerText,
        rating: card.querySelector('.stars').innerText,
      }));
    });

    return {
      success: true,
      action: "Performed search and extracted product data",
      extractedData: { results },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
